import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router';
import './FormPreview.css';
const { REACT_APP_API_ENDPOINT } = process.env;

const FormPreview = () => {
    const sessionStorageUser = JSON.parse(localStorage.getItem('user') || '');
    
    let { id } = useParams();

    const [data, setData] = useState<any>({});
    useEffect(() => {
        if (id) {
            getForm(id);
        }
    }, [])

    const [logo, setLogo] = useState<string>('');

    useEffect(() => {
        fetch(`${REACT_APP_API_ENDPOINT}/pdf/logo`, {
            method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${sessionStorageUser.token}`
        },
        })
        .then((r) => r.json())
        .then((r) => {
            setLogo(r.logo);
        })
    }, [])

    const getForm = (id: string) => {
        fetch(`${REACT_APP_API_ENDPOINT}/forms/${id}`, {
            method: 'GET',
        headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${sessionStorageUser.token}`
        },
        })
        .then((r) => r.json())
        .then((r) => {
            setData(r.data);
        })
    }

    const parse = (el: any) => {
        const elements: JSX.Element[] = [];
        for (const key in el) {
            let sections: any[] = el[key];
            sections.forEach((section: any, index: number) => {
                elements.push(<div><h2>{(index + 1) + '. ' + section.name}</h2><div className='section' dangerouslySetInnerHTML={{__html: section.value}}></div></div>)
            })
        }
        return elements;
      };
   
      function compressBase64Image(base64Image: string, maxWidth: number, maxHeight: number, quality: number) {
        const img = new Image();
        img.src = base64Image;
        const canvas = document.createElement('canvas');
        const ctx = canvas.getContext('2d');
        if (ctx) {
            let width = img.width;
            let height = img.height;
        
            if (width > maxWidth) {
                height *= maxWidth / width;
                width = maxWidth;
            }
        
            if (height > maxHeight) {
                width *= maxHeight / height;
                height = maxHeight;
            }
        
            canvas.width = width;
            canvas.height = height;
            ctx.drawImage(img, 0, 0, width, height);
        
            var compressedBase64Image;
            if (base64Image.includes('png')) {
                compressedBase64Image = canvas.toDataURL('image/png', quality);
            } else {
                compressedBase64Image = canvas.toDataURL('image/jpg', quality);
            }
            return compressedBase64Image;
        }
        return '';
    }
    
    

      return (
        <div>
            <button onClick={() => {
                fetch(`${REACT_APP_API_ENDPOINT}/pdf/generate`, {
                    method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${sessionStorageUser.token}`
                },
                body: JSON.stringify(
                    {
                        html: document.getElementById('all')?.outerHTML,
                        options: {
                            logo: '',
                            title: data.title,
                            code: data.code,
                            version: data.version
                        }
                    }
                )
                })
                .then((r) => r.blob())
                .then((r) => {
                    const url = window.URL.createObjectURL(new Blob([r]));
                    const link = document.createElement('a');
                    link.href = url;
                    link.setAttribute('download', 'formulario.pdf');
                    document.body.appendChild(link);
                    link.click();
                })
            }}>Descargar</button>
        <div id='all' style={{ fontFamily: 'Arial Narrow', fontSize: '12px', marginLeft: '30px', marginRight: '30px', marginBottom: '30px' }}>
        <div id='pageHeader' className='hd'>
        <table style={{width: '90%', borderCollapse: 'collapse', border: '1px solid', margin: '5%', textAlign: 'center'}}>
              <tr style={{textAlign: 'center'}}>
                  <td style={{width: '15%'}}><img style={{height: '50px', width: '50px'}} src={compressBase64Image(logo, 300, 300, 0.2)}/></td>
                  <td style={{textAlign: 'center', border: '1px solid black', width: '70%'}}><b>{String(data.title).toUpperCase()}</b></td>
                  <td style={{width: '15%'}}>
                    <table style={{fontSize: '12px', width: '100%', margin: 0}}>
                      <tr style={{border: '1px solid black'}}>
                        <td style={{border: '1px solid black'}}>
                         Código
                        </td>
                        <td style={{border: '1px solid black'}}>
                         {data.code}
                        </td>
                      </tr>
                      <tr style={{border: '1px solid black'}}>
                         <td style={{border: '1px solid black'}}>
                          Versión
                        </td>
                        <td style={{border: '1px solid black'}}>
                          {data.version}
                        </td>
                      </tr>
                      <tr>
                      <td style={{border: '1px solid black'}}>
                          Fecha
                        </td>
                        <td style={{border: '1px solid black'}}>
                          { new Date().toLocaleDateString() }
                        </td>
                      </tr>
                    </table>
                  </td>
              </tr>
          </table>
        </div>
            <div className='pages' id='pages'>
                {parse(data.form)}
            </div>
            <div style={{textAlign: 'center'}} id="pageFooter"><img src='data:image/png;base64,' style={{height: '40px'}}/></div>
            </div>
        </div>
      );
};

export default FormPreview;
